import React from 'react';

function EmployeeCard(props) {

    const imgContTop = {
        background: `url('./images/jack.jpg')`,
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover',
        display: 'block',
        height: '100%',
        width: '15vw',
        borderRadius: '50%',
    }

    const contDesc = {
        height: '100%',
        width: '60%',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'space-between',
    }

    const nameDesc = {
        display: 'flex',
        flexDirection: 'column',
    }

    const contactDesc = {
        fontSize: '2vw',
        fontWeight: '600',
        letterSpacing: '1px',
        margin: '0 0 5vh 0',
    }


  return (
    <div className="employeeCard">
      <div style={ imgContTop }></div>
        <div style={ contDesc }>
            <div style={ nameDesc }>
                <div style={{fontWeight: '600',fontSize: "2.5vw"}}> Jack Mencia </div>
                <div style={{fontSize: '10px'}}> President and CEO, CBSI </div>
            </div>
            <div style={contactDesc}>
                jack@cbsi.co
            </div>
        </div>
    </div>
  );
}

export default EmployeeCard;
